    <script>

const bodyView = swim.HtmlView.fromNode(document.body);

const mapView = new swim.WorldMapView.create();
mapView.modifyMood(swim.Feel.default, [[swim.Feel.primary, 1]]);

function addGeoShapes(shapes, mapView) {
  for (let i = 0; i < shapes.length; i += 1) {
    const shape = shapes[i];
    if (shape instanceof swim.GeoGroup) {
      const layerView = mapView.appendChild(swim.GeoLayerView);
      addGeoShapes(shape.shapes, layerView)
    } else if (shape instanceof swim.GeoPath) {
      const shapeView = mapView.appendChild(swim.GeoAreaView)
        .geoPath(shape)
        .fill("#28292a")
        .on("pointerenter", function (event) {
          shapeView.fill("#5a5a5a", shapeView.getLook(swim.Look.timing));
        })
        .on("pointerleave", function (event) {
          shapeView.fill("#28292a", shapeView.getLook(swim.Look.timing));
        });
    }
  }
}
